import './App.css'

// Container for Chatbox and ChatList Containers.
function MainBox () {
  return (
    <>
    <div className="mainbox">
        <ChatList />
        <ChatBox />
    </div>
    </>
  )
}

// Chat Container Component
function ChatBox () {
  return (
    <>
    <div className="chatbox">
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <Message sender='User1' msg='Hello!' />
      <div className="inputandsend">
        <Button name='SEND' />
        <input placeholder='Send Message' className='inputbar'></input>
      </div>
    </div>
    </>
  )
}

// Chat List Container Component
function ChatList () {
  return (
    <>
    <div className="chatlist">

    </div>
    </>
  )
}

// Navigation Bar Component
function Navbar () {
  return (
    <>
    <div className="navbar">
      <Button name='PROFILE' />
      <Button name='LOG OUT' />
      <Button name='ABOUT US' />
    </div>
    </>
  )
}

// Button Component
function Button ({ name }) {
  return (
    <>
    <button className="Button">
        {name}
    </button>
    </>
  )
}

// Message Component
function Message ({ sender , msg }) {
  return (
    <>
    <div className="message">
        {sender} : {msg}
    </div>
    </>
  )
}

// Main Page
export default function Page () {
  return (
    <>
      <div clasName='Page'>
        <Navbar />
        <MainBox />
      </div>
    </>
  );
}
